import React from 'react';
import { Container } from 'react-bootstrap';

const Oswiadczenia = () => {
  return (
    <Container>
      <h1>Oświadczenia</h1>
      <p>Informacje o oświadczeniach majątkowych.</p>
    </Container>
  );
};

export default Oswiadczenia;
